import react from 'react'

export default function ChatApp() {
    return(
        <View style={styles.chatContainer}>
            <Text>Connected: {connected}</Text>
            <Text>Ping Connected: {pingData}</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    chatContainer: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center'
    }
  });
